Rear Admiral '''Giorgio Lazio''' is an Italian Navy officer. He is designated as the next Commander Maritime Command North ({{lang|it|Comandante del Comando Marittimo Nord}}).<ref name="Cittadella">{{cite web | url=http://www.cittadellaspezia.com/La-Spezia/Attualita/L-ammiraglio-Giorgio-Lazio-per-220072.aspx | title=L'ammiraglio Giorgio Lazio per raccogliere il testimone di Camerini | date=October 28, 2016 | accessdate=November 9, 2016}}</ref>
He graduated from the Naval Academy in 1983.<ref name="MILCOM">{{cite web | url=http://www.marina.difesa.it/EN/events/rss_eng/eng_2010/sessions/Documents/ORGANIZATIONS/NATO%20MILITARY%20COMMITTEE.pdf | title=REAR ADMIRAL (LH) GIORGIO LAZIO | publisher=NATO | accessdate=November 9, 2016}}</ref>
He has completed a degree in Maritime and Naval Sciences as well as a master's degree in International Strategic-Military Studies.<ref name="MILCOM"/>
